import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { useLocation } from 'react-router-dom';



export default function Viewallusers() {

    const [data, setData] = useState([]);
    const statedata = useLocation();
    const authtoken = statedata.state.authtoken;





    useEffect(() => {
        axios.get("http://localhost:4000/admin/getallusers", {
            headers: {
                "AdminAuthToken": authtoken
            }
        })
            .then((res) => {
               setData(res.data);

            })
            .catch(err => console.error(err));
    }, []);


    return (
        <div className='viewatt-table-div'>

            <table className="table table-success table-striped ">

                <thead>
                    <tr>
                        <th scope="col">No</th>
                        <th className="col">Student Name</th>
                        <th className="col">Student Id</th>
                        <th scope="col">email</th>
                        <th scope="col">Total Presents</th>
                        <th scope='col'>Action</th>

                    </tr>
                </thead>
                <tbody>
                    {
                        data.map((item) => {
                            return <tr>
                                <th scope="row">1</th>
                                <td>{ item.name}</td>
                                <td>{ item.id}</td>
                                <td>{ item.email}</td>
                                <td>To implement</td>
                                <td>click</td>
                            </tr>
                        })
                    }

                </tbody>
            </table>

        </div>
    )
}
